import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import useScrollTrigger from '@material-ui/core/useScrollTrigger';


const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    burgerBtn: {
        marginRight: theme.spacing(2),
        color: "white",
    },
    rightMenu: {
        color: "white",
    },
    title: {
        flexGrow: 1,
    },
    appb: {
        background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
    }
}));

const Header = () => {
    const classes = useStyles();
    const trigger = useScrollTrigger();

    return (
        // <div className="main-header">
        //     <div className="header">
        //         <div className="header-logo">logo</div>
        //         <div className="menu">
        //             <div className="menu-item">Startsida</div>
        //             <div className="menu-item">Om mig</div>
        //             <div className="menu-item">Kompetens</div>
        //             <div className="menu-item">Erfarenhet</div>
        //             <div className="menu-item">Portofölj</div>
        //             <div className="menu-item">Kontakt</div>
        //         </div>
        //     </div>
        // </div>
        <AppBar position="fixed" color={!trigger ? "transparent" : classes.appb} elevation={0}>
            <Toolbar>
                <IconButton edge="start" className={classes.burgerBtn} color="inherit" aria-label="menu">
                    <MenuIcon />
                </IconButton>
                <Typography variant="h6" className={classes.title}>Logo</Typography>

                <Button className={classes.rightMenu}>Startsida</Button>
                <Button className={classes.rightMenu}>Om mig</Button>
                <Button className={classes.rightMenu}>Kompetens</Button>
                <Button className={classes.rightMenu}>Erfarenhet</Button>
                <Button className={classes.rightMenu}>Portofölj</Button>
                <Button className={classes.rightMenu}>Kontakt</Button>

            </Toolbar>
        </AppBar>
    );
};

export default Header;
